    const {mainPosts} = useSelector((state) => state.post);
    return (
        <AppLayout>
            {/* PostForm은 로그인한 사람들에게만 보임 */}
            {isLoggedIn && <PostForm />}
            <PostCard />
        </AppLayout>
    );
}

export default Home;
